import React from "react";
import { Container } from "react-bootstrap";
import "./SignIn.scss";

export default function Maincontent() {
  return (
    <div className="sign-in-page-main">
      <Container className="">
        <h2>Welcome Back</h2>
        <p>Enter your email and password to sign in</p>
      </Container>
      <div className="right-block"></div>
    </div>
  );
}
